import React from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const styles = {
    container: {
      display: "flex",
      minHeight: "100vh",
      fontFamily: "Arial, sans-serif",
    },
    sidebar: {
      width: "250px",
      backgroundColor: "#2c3e50",
      color: "#ecf0f1",
      padding: "20px",
    },
    sidebarTitle: {
      fontSize: "24px",
      fontWeight: "bold",
      textAlign: "center",
      marginBottom: "20px",
    },
    sidebarLink: {
      color: "#ecf0f1",
      textDecoration: "none",
      display: "block",
      padding: "10px 15px",
      borderRadius: "5px",
      transition: "background-color 0.3s ease",
    },
    sidebarLinkHover: {
      backgroundColor: "#34495e",
    },
    mainContent: {
      flexGrow: 1,
      padding: "20px",
    },
    header: {
      backgroundColor: "#007BFF",
      color: "#fff",
      textAlign: "center",
      padding: "15px",
      borderRadius: "5px",
    },
    row: {
      display: "flex",
      flexWrap: "wrap",
      gap: "20px",
      marginTop: "20px",
      justifyContent: "center",
    },
    card: {
      flex: "0 1 calc(33.333% - 20px)", // 3 cards per row
      backgroundColor: "#fff",
      borderRadius: "10px",
      boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
      transition: "transform 0.3s ease, box-shadow 0.3s ease",
      padding: "20px",
      textAlign: "center",
    },
    cardHover: {
      transform: "translateY(-5px)",
      boxShadow: "0 6px 12px rgba(0, 0, 0, 0.2)",
    },
    cardTitle: {
      fontSize: "1.25rem",
      fontWeight: "bold",
      marginBottom: "10px",
    },
    cardText: {
      fontSize: "1rem",
      color: "#6c757d",
      marginBottom: "15px",
    },
    cardLink: {
      display: "inline-block",
      padding: "8px 15px",
      backgroundColor: "#007BFF",
      color: "#fff",
      textDecoration: "none",
      fontWeight: "bold",
      borderRadius: "5px",
      transition: "background-color 0.3s ease",
    },
    cardLinkHover: {
      backgroundColor: "#0056b3",
    },
  };

  return (
    <div style={styles.container}>
      {/* Sidebar */}
      <div style={styles.sidebar}>
        <h2 style={styles.sidebarTitle}>ADMIN</h2>
        <ul style={{ listStyleType: "none", padding: 0 }}>
          {[
            { to: "/", label: "Dashboard" },
            { to: "/StudentDetails", label: "StudentDetails" },
            { to: "/StudentRegistration", label: "StudentRegistration" },
            { to: "/MarkView", label: "MarkView" },
            { to: "/station-registration", label: "Station Master Registration" },
            { to: "/station-list", label: "Station Master List" },
            { to: "/report", label: "Report" },
            { to: "/logout", label: "Logout" },
          ].map((link, index) => (
            <li key={index} style={{ marginBottom: "10px" }}>
              <Link
                to={link.to}
                style={styles.sidebarLink}
                onMouseEnter={(e) => (e.target.style.backgroundColor = "#34495e")}
                onMouseLeave={(e) => (e.target.style.backgroundColor = "")}
              >
                {link.label}
              </Link>
            </li>
          ))}
        </ul>
      </div>

      {/* Main Content */}
      <div style={styles.mainContent}>
        <header style={styles.header}>
          <h1>Welcome to AQUAMOTUS - Admin Dashboard</h1>
        </header>
        <div style={styles.row}>
          {[
            { title: "Boat", text: "Manage Boat Details", to: "/boat" },
            { title: "Event", text: "Manage Events", to: "/event" },
            { title: "Settings", text: "Manage Station Master Details", to: "/settings" },
          ].map((card, index) => (
            <div
              key={index}
              style={styles.card}
              onMouseEnter={(e) =>
                Object.assign(e.currentTarget.style, styles.cardHover)
              }
              onMouseLeave={(e) =>
                Object.assign(e.currentTarget.style, {
                  transform: "",
                  boxShadow: "",
                })
              }
            >
              <h3 style={styles.cardTitle}>{card.title}</h3>
              <p style={styles.cardText}>{card.text}</p>
              <Link
                to={card.to}
                style={styles.cardLink}
                onMouseEnter={(e) => (e.target.style.backgroundColor = "#0056b3")}
                onMouseLeave={(e) => (e.target.style.backgroundColor = "#007BFF")}
              >
                More info &#8594;
              </Link>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
